import { useEffect, useState } from "react";
import api from "../api";
import "./Projects.css";

export default function Projects() {
  const [projects, setProjects] = useState([]);
  const [editingId, setEditingId] = useState(null);
  const [showForm, setShowForm] = useState(false);
  const [showDetails, setShowDetails] = useState(null);

  const [images, setImages] = useState([]);
  const [floorPlans, setFloorPlans] = useState([]);
  const [amenitiesInput, setAmenitiesInput] = useState("");

  const [form, setForm] = useState({
    projectName: "",
    projectType: "flat",
    location: "",
    totalWings: "",
    totalFloors: "",
    perFloorHouse: "",
    totalPlots: "",
    geoLocation: { lat: "", lng: "" },
  });

  /* ================= FETCH PROJECTS ================= */
  const fetchProjects = async () => {
    try {
      const res = await api.get("/lily/");
      setProjects(res.data.data || []);
    } catch (err) {
      console.error("Failed to fetch projects", err);
      setProjects([]);
    }
  };

  useEffect(() => {
    fetchProjects();
  }, []);

  /* ================= SUBMIT ================= */
  const handleSubmit = async (e) => {
    e.preventDefault();
    const formData = new FormData();

    formData.append("projectName", form.projectName);
    formData.append("projectType", form.projectType);
    formData.append("location", form.location);

    if (form.projectType === "flat") {
      formData.append("totalWings", form.totalWings);
      formData.append("totalFloors", form.totalFloors);
      formData.append("perFloorHouse", form.perFloorHouse);
    } else {
      formData.append("totalPlots", form.totalPlots);
    }

    if (form.geoLocation?.lat && form.geoLocation?.lng) {
      formData.append("geoLocation[type]", "Point");
      formData.append("geoLocation[coordinates][0]", form.geoLocation.lng);
      formData.append("geoLocation[coordinates][1]", form.geoLocation.lat);
    }

    if (amenitiesInput) {
      amenitiesInput
        .split(",")
        .map((a) => a.trim())
        .forEach((a) => formData.append("amenities[]", a));
    }

    images.forEach((img) => formData.append("images", img));
    floorPlans.forEach((fp) => formData.append("floorPlans", fp));

    try {
      if (editingId) await api.put(`/lily/${editingId}`, formData);
      else await api.post("/lily/", formData);
      resetForm();
      fetchProjects();
      alert("Success!");
    } catch (err) {
      console.error(err);
      alert("Failed to save project");
    }
  };

  /* ================= HELPERS ================= */
  const resetForm = () => {
    setForm({
      projectName: "",
      projectType: "flat",
      location: "",
      totalWings: "",
      totalFloors: "",
      perFloorHouse: "",
      totalPlots: "",
      geoLocation: { lat: "", lng: "" },
    });
    setAmenitiesInput("");
    setImages([]);
    setFloorPlans([]);
    setEditingId(null);
    setShowForm(false);
  };

  const handleEdit = (p) => {
    setEditingId(p.id);
    setForm({
      ...p,
      geoLocation: p.geoLocation?.coordinates
        ? { lat: p.geoLocation.coordinates[1], lng: p.geoLocation.coordinates[0] }
        : { lat: "", lng: "" },
    });
    setAmenitiesInput((p.amenities || []).join(", "));
    setShowForm(true);
  };

  const handleDelete = async (id) => {
    if (window.confirm("Delete this project?")) {
      await api.delete(`/lily/${id}`);
      fetchProjects();
    }
  };

  const handleThumbnailClick = (project) => {
    setShowDetails(project);
  };

  /* ================= UI ================= */
  return (
    <div className="projects-page">
      <button className="btn-submit" onClick={() => setShowForm(true)}>
        + Add New Project
      </button>

      {/* ================= TABLE ================= */}
      <table>
        <thead>
          <tr>
            <th>#</th>
            <th>Name</th>
            <th>Type</th>
            <th>Location</th>
            <th>Geo (lat,lng)</th>
            <th>Wings/Floors/Plots</th>
            <th>Amenities</th>
            <th>Images / Floor Plans</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {projects.map((p, i) => (
            <tr key={p.id}>
              <td>{i + 1}</td>
              <td>{p.projectName || "-"}</td>
              <td>{p.projectType || "-"}</td>
              <td>{p.location || "-"}</td>
              <td>
                {p.geoLocation?.coordinates
                  ? `${p.geoLocation.coordinates[1]}, ${p.geoLocation.coordinates[0]}`
                  : "-"}
              </td>
              <td>
                {p.projectType === "flat"
                  ? `${p.totalWings || 0} Wings / ${p.totalFloors || 0} Floors / ${
                      p.perFloorHouse || 0
                    } per Floor`
                  : p.totalPlots || 0}
              </td>
              <td>{(p.amenities || []).join(", ") || "-"}</td>
              <td>
                {(p.images || []).slice(0, 2).map((img, idx) => (
                  <img
                    key={idx}
                    src={img.url}
                    alt="project"
                    style={{ width: "50px", marginRight: "5px", cursor: "pointer" }}
                    onClick={() => handleThumbnailClick(p)}
                  />
                ))}
                {(p.floorPlans || []).slice(0, 2).map((fp, idx) => (
                  <img
                    key={idx}
                    src={fp.url}
                    alt="floorplan"
                    style={{ width: "50px", marginRight: "5px", cursor: "pointer" }}
                    onClick={() => handleThumbnailClick(p)}
                  />
                ))}
              </td>
              <td>
                <button onClick={() => handleEdit(p)}>Edit</button>
                <button onClick={() => handleDelete(p.id)}>Delete</button>
                <button onClick={() => setShowDetails(p)}>View Details</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* ================= VIEW DETAILS MODAL ================= */}
      {showDetails && (
        <div className="modal">
          <div className="modal-content" style={{ maxHeight: "80vh", overflowY: "auto" }}>
            <h2>{showDetails.projectName} - Details</h2>
            <hr />
            <p><b>Type:</b> {showDetails.projectType}</p>
            <p><b>Location:</b> {showDetails.location}</p>
            <p>
              <b>Geo (lat,lng):</b>{" "}
              {showDetails.geoLocation?.coordinates
                ? `${showDetails.geoLocation.coordinates[1]}, ${showDetails.geoLocation.coordinates[0]}`
                : "-"}
            </p>
            {showDetails.projectType === "flat" ? (
              <p>
                <b>Wings/Floors/Houses:</b> {showDetails.totalWings} / {showDetails.totalFloors} / {showDetails.perFloorHouse}
              </p>
            ) : (
              <p><b>Total Plots:</b> {showDetails.totalPlots}</p>
            )}
            <p><b>Amenities:</b> {(showDetails.amenities || []).join(", ") || "-"}</p>

            <div>
              <h4>Project Images</h4>
              <div style={{ display: "flex", gap: "10px", flexWrap: "wrap" }}>
                {(showDetails.images || []).map((img, idx) => (
                  <img
                    key={idx}
                    src={img.url}
                    alt={`project-${idx}`}
                    style={{ width: "150px", borderRadius: "8px", objectFit: "cover" }}
                  />
                ))}
              </div>
            </div>

            <div style={{ marginTop: "20px" }}>
              <h4>Floor Plans</h4>
              <div style={{ display: "flex", gap: "10px", flexWrap: "wrap" }}>
                {(showDetails.floorPlans || []).map((fp, idx) => (
                  <img
                    key={idx}
                    src={fp.url}
                    alt={`floorplan-${idx}`}
                    style={{ width: "150px", borderRadius: "8px", objectFit: "cover" }}
                  />
                ))}
              </div>
            </div>

            <button className="btn-close" onClick={() => setShowDetails(null)}>Close</button>
          </div>
        </div>
      )}
    </div>
  );
}
